import React from "react";
import Header from "../Header/Header";
import Footer from "../Footer/Foot";
import Products from "../Products.jsx/Products";
import ProductData from "../Data/ProductData";

function Cars() {
  const pro = ProductData.map((item) => {
    return (
      <Products
        img={pro[item].img}
        price={pro[item].price}
        engine={pro[item].engine}
        fuel={pro[item].fuel}
        hspwr={pro[item].horsepower}
        mileage={pro[item].mileage}
      />
    );
  });
  return (
    <React.Fragment>
      <Header />
      <div className="container-fluid d-flex justify-content-center">
        <div className="row mt-4 p-3">
          <pro></pro>
          <Footer />
        </div>
      </div>
    </React.Fragment>
  );
}
export default Cars;
